手写简单 parser
定义变化
struct Node {
-    Node* expr;
+    Node* lexpr;
+    Node* rexpr;
}

现在需要储存两个 expression。
parse 过程变化
按照产生式变化对应修改即可，很简单。
expression
    : additive

additive
    : multiplicative
    | additive ('+'|'-') multiplicative

// ...

primary
    : Integer
